t":"Se red acum"}]}}}]}}],"trackingParams":"CPwCEMY5IhMI_ZaM_oDY_wIVWssRCB1nZwvR","visibleItemCount":4,"nextButton":{"buttonRenderer":{"style":"STYLE_DEFAULT","size":"SIZE_DEFAULT","isDisabled":false,"icon":{"iconType":"CHEVRON_RIGHT"},"accessibility":{"label":"nainte"},"trackingParams":"CP4CEPBbIhMI_ZaM_oDY_wIVWssRCB1nZwvR"}},"previousButton":{"buttonRenderer":{"style":"STYLE_DEFAULT","size":"SIZE_DEFAULT","isDisabled":false,"icon":{"iconType":"CHEVRON_LEFT"},"accessibility":{"label":"napoi"},"trackingParams":"CP0CEPBbIhMI_ZaM_oDY_wIVWssRCB1nZwvR"}}}},"subtitle":{"simpleText":"Anjunadeep label favorite and rising star of the electronic scene Tom Marshall, aka Marsh, is pleased to present his third artist album Endless.\n\nFew artists exude as much passion for, and dedication to, their craft as Tom Marshall (AKA Marsh). Since he first emerged on the electronic music scene in the mid-2010s, Marsh has sculpted a uniquely soulful sound that has captivated his listeners and earned him a fast-growing and intensely devoted fanbase.\n\nEndless follows two previous bodies of work; his 2017 debut Life On The Shore, and his critically-acclaimed Anjunadeep debut LP, Lailonie, the latter of which has accumulated over 20 million streams to date, and sold over 1500 vinyl copies. Marsh also has an array of widely-supported anthems in his discography. Come Together (with Nox Vahn), Little Darling and the Beatport chart-topping Lost In You are some of his best-loved tracks, all streaming well into the millions and winning support from electronic musics most prominent artists, including Joris Voorn, Pete Tong, Diplo, and RFS DU SOL.\n\nThe two years since Marsh released his previous album Lailonie have seen Tom moving around the States and touring the globe in a world rapidly opening up post-pandemic. This whirlwind, semi-nomadic lifestyle has inspired his third artist album Endless, and caused him to take stock of his values. In his own words, Ive written this entire album on the move, writing from so many different homes. On a deeper, more spiritual level, this has led me to question, what is truly home, and will we experience home after this life?\n\nEndless comprises eleven memorable tracks, including collaborations with vocalists Jodie Knight, Leo Wood and Mariel Beausejour. Drawing on influences as diverse as the rich trance sounds of the 2000s that soundtracked his teenage years, and the musicality of crossover drum \u0026 bass acts like Pendulum, Toms next offering is perhaps his most expansive in scope. Opening with the subtle first track Pneuma, the album moves from emotive and lyrical tracks like Sleep and Forgiveness, to piano house melodies on Reminiscent, smooth broken beats on Blue, and pulsing deep house on the Jodie Knight vocal-led Fragments, all united by Marshs innate warm musicality.\n\nEndless is accompanied by an impressive album tour. Phase one comprises 26 dates across North and South America with the first three dates sold out. Phase two dates will be on sale around the album release and feature a lone UK performance on April 08 at Electric Brixton."},"trackingParams":"CPoCENwcGAAiEwj9loz-gNj_AhVayxEIHWdnC9E=","playAllButton":{"buttonRenderer":{"style":"STYLE_TEXT","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Red-le pe toate"}]},"icon":{"iconType":"PLAY_ALL"},"navigationEndpoint":{"clickTrackingParams":"CPsCEPBbIhMI_ZaM_oDY_wIVWssRCB1nZwvR","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=MFEeAF4z9FI\u0026list=PLOftnzGIKwJDgcOaTRDspaE-UxkvNOpZO","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"MFEeAF4z9FI","playlistId":"PLOftnzGIKwJDgcOaTRDspaE-UxkvNOpZO","loggingContext":{"vssLoggingContext":{"serializedContextData":"GiJQTE9mdG56R0lLd0pEZ2NPYVRSRHNwYUUtVXhrdk5PcFpP"}},"watchEndpointSupportedOnesieConfig":{"html5PlaybackOnesieConfig":{"commonConfig":{"url":"https://rr3---sn-8vq54voxgv-vu26.googlevideo.com/initplayback?source=youtube\u0026oeis=1\u0026c=WEB\u002
